import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assets/logos/logo-3.png';
import './css/Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="logo-section">
        <img src={logo} alt="Logo" className="logo-image" />
        <div className="logo-text">QuillQuest</div>
      </div>
      <nav className="nav-links">
        <Link to="/essay-relay">Essay Relay</Link>
        <Link to="/home">Home</Link>
        <Link to="/create-post">Create Post</Link>
      </nav>
      <div className="user-menu">
        <Link to="/notifications"><i className="bell-icon"></i></Link>
        <Link to="/profile" className="user-icon">U</Link>
      </div>
    </header>
  );
};

export default Header;
